Attorney Nathan Francis Opland-Dobs appears in court with Defendant, Justin Deangelo Hollis.  Chad Wozniak appears for the State of Wisconsin.

Matter here for plea/sentencing.  As to plea:  AS TO COUNT #1:  Defendant was advised of constitutional rights and maximum penalties, waived all rights, and plead GUILTY.  Defendant examined as to the plea.  Stipulation by parties to the Criminal Complaint as a factual basis to sustain the plea.  Court found the defendant guilty.  Judgment of conviction entered.
  
Court advised defendant that as a convicted felon he may never possess any gun or other firearms. 
Court advised defendant that his voting rights are suspended, and may not vote in any election until his civil rights are restored.  

Court advised defendant if he is not a citizen of the United States of America, that upon a plea of guilty or no contest for this offense, he could be deported, excluded from admission to his country, or denied naturalization under federal law.  
Court advised that the defendant will have to provide a DNA sample, to the Wisconsin State Crime Laboratory for DNA testing and pay a DNA surcharge.

Sentencing proceeded.  Statements by the State, defense and defendant.  Statements made as to sentencing.  The Court sentenced the defendant to serve ONE (1) YEAR in the House of Correction, STRAIGHT TIME with credit for ONE (1) DAY time served.  The Court STAYED this sentence and placed the defendant on probation for a period of TWO (2) YEARS with the following conditions:

1) Advise any and all potential employers of conviction; 
2) Pay restitution in the amount of $3,000 to victim, Home Depo, FIRST.  There is to be a wage assignment done to start paying restitution; 
3) Pay supervision fees;
4) Provide a DNA sample - pay surcharge; 
5) Pay all remaining mandatory costs, fees, surcharges and assessments by the end of probation period or balance to convert to civil judgment;

